import React from 'react'
import Footer from './Footer';
import Header from './Header';
import Note from './Note'
import notes from "../notes"

function App(){
    return <div>
        <Header/>
        {notes.map(note => {
            return(<Note
                key={note.key}
                title={note.title}
                content={note.content}
            />)
        })}
        
        <Footer/>
    </div>
     
}

export default App;
